import React from "react";
import { ScoreFont } from "./Style";
import { Jumbotron, Button, Carousel } from "react-bootstrap"

export const HomePage = () => (
  <div>
    <Jumbotron>
      <ScoreFont>Googly</ScoreFont>
      <p>A game that revolves around the quality of education.</p>
      <Button variant="outline-info" href="https://github.com/JamieJiHeonKim/Googly-Word-Game">GitHub</Button>
    </Jumbotron>
    <body>
      <ScoreFont>Contact</ScoreFont>
    </body>
  </div>

);
